--  DDL for Trigger FACTOR_TRG
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "DBP"."FACTOR_TRG" 
BEFORE INSERT ON FinancialFactor
FOR EACH ROW
BEGIN
    :NEW.factor_id := 'FF-' || LPAD(Factor_SEQ.NEXTVAL, 6, '0');
END;

/
ALTER TRIGGER "DBP"."FACTOR_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger UPDATE_FF2CS_TRG
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "DBP"."UPDATE_FF2CS_TRG" 
AFTER INSERT OR UPDATE ON FinancialFactor
FOR EACH ROW
BEGIN
    -- 재무적 요소 테이블의 '총 점수'가 변동된 경우에만 실행
    IF NVL(:NEW.total_score, 0) != NVL(:OLD.total_score, 0)
        THEN UpdateCreditScore(:NEW.company_id);
    END IF;
END;

/
ALTER TRIGGER "DBP"."UPDATE_FF2CS_TRG" ENABLE;
